import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';

const RideRequest = () => {
  const [pickupLocation, setPickupLocation] = useState('');
  const [destination, setDestination] = useState('');
  const [dateTime, setDateTime] = useState('');
  const [seats, setSeats] = useState('');
  const [error, setError] = useState('');
  const [fareEstimate, setFareEstimate] = useState(null);
  const navigate = useNavigate();
  const graphhopperApiKey = '7ec57cd6-a8bb-4c68-98c2-61d051f28e6e'; // Replace with your GraphHopper API key

  useEffect(() => {
    // Fetch user's location
    if (navigator.geolocation) {
      navigator.geolocation.getCurrentPosition(
        (position) => {
          const { latitude, longitude } = position.coords;
          // Fetch address from coordinates
          axios
            .get(`https://graphhopper.com/api/1/geocode?point=${latitude},${longitude}&reverse=true&key=${graphhopperApiKey}`)
            .then((response) => {
              const address = response.data.hits[0]?.name || '';
              setPickupLocation(address);
            })
            .catch((error) => {
              console.error('Error fetching address:', error);
            });
        },
        (error) => {
          console.error('Error fetching user location:', error);
        }
      );
    }
  }, []);

  const getFareEstimate = async () => {
    try {
      // Geocode pickup and destination locations to get latitude and longitude
      const pickupResponse = await axios.get(`https://graphhopper.com/api/1/geocode?q=${pickupLocation}&key=${graphhopperApiKey}`);
      const destinationResponse = await axios.get(`https://graphhopper.com/api/1/geocode?q=${destination}&key=${graphhopperApiKey}`);
      const pickupCoords = pickupResponse.data.hits[0].point;
      const destinationCoords = destinationResponse.data.hits[0].point;

      // Fetch fare estimate from Uber API
      const response = await axios.get('/api/uber-price', {
        params: {
          start_latitude: pickupCoords.lat,
          start_longitude: pickupCoords.lng,
          end_latitude: destinationCoords.lat,
          end_longitude: destinationCoords.lng,
        },
      });

      const estimates = response.data.prices;
      setFareEstimate(estimates[0].estimate); // Assume the first estimate is what we need
    } catch (error) {
      console.error('Error fetching fare estimate:', error);
      setError('Failed to fetch fare estimate');
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      // Make a POST request to the backend to create a ride request
      const response = await axios.post('/api/ride-request', {
        pickupLocation,
        destination,
        dateTime,
        seats,
      });

      if (response.status === 200) {
        navigate('/profile');
      } else {
        const errorText = await response.text();
        setError(errorText);
      }
    } catch (error) {
      console.error('Error:', error);
      setError('An error occurred');
    }
  };

  return (
    <div className="flex items-center justify-center h-screen bg-gray-100">
      <div className="bg-white p-8 rounded shadow-md w-full max-w-md">
        <h1 className="text-2xl mb-6 text-center">Make a Ride Request</h1>
        {error && <div className="text-red-500">{error}</div>}
        <form onSubmit={handleSubmit}>
          <div className="mb-4">
            <label htmlFor="pickupLocation" className="block text-gray-700">Pickup Location</label>
            <input
              type="text"
              id="pickupLocation"
              value={pickupLocation}
              onChange={(e) => setPickupLocation(e.target.value)}
              className="mt-1 p-2 w-full border rounded"
              required
            />
          </div>
          <div className="mb-4">
            <label htmlFor="destination" className="block text-gray-700">Destination</label>
            <input
              type="text"
              id="destination"
              value={destination}
              onChange={(e) => setDestination(e.target.value)}
              className="mt-1 p-2 w-full border rounded"
              required
            />
          </div>
          <div className="mb-4">
            <label htmlFor="dateTime" className="block text-gray-700">Date & Time</label>
            <input
              type="datetime-local"
              id="dateTime"
              value={dateTime}
              onChange={(e) => setDateTime(e.target.value)}
              className="mt-1 p-2 w-full border rounded"
              required
            />
          </div>
          <div className="mb-6">
            <label htmlFor="seats" className="block text-gray-700">Seats</label>
            <input
              type="number"
              id="seats"
              value={seats}
              onChange={(e) => setSeats(e.target.value)}
              className="mt-1 p-2 w-full border rounded"
              required
            />
          </div>
          <button
            type="button"
            onClick={getFareEstimate}
            className="w-full bg-blue-500 text-white p-2 rounded hover:bg-blue-600 mb-4"
          >
            Get Fare Estimate
          </button>
          {fareEstimate && (
            <div className="text-center text-gray-700 mb-4">
              Estimated Fare: {fareEstimate}
            </div>
          )}
          <button
            type="submit"
            className="w-full bg-blue-500 text-white p-2 rounded hover:bg-blue-600"
          >
            Request Ride
          </button>
        </form>
      </div>
    </div>
  );
};

export default RideRequest;
